import './section2.css';

class Section2 extends Component {
  render() {
    console.log(this.props.data.work_experience);
    const work = this.props.data.work_experience
    return (
        <div className ="Section2">
            <div className="Name">
              <label>
                  {this.props.data.personal_information.name}
                  {this.props.data.personal_information.last_name}
              </label>
              {this.props.data.personal_information.title_carreer}
            </div>
        </div>
    )
  }
}

export default Section2
